    "next/core-web-vitals",
    "eslint:recommended",
    "plugin:@typescript-eslint/recommended"
  ],
  "rules": {
    "@next/next/no-img-element": "off",
    "@typescript-eslint/no-explicit-any": "off",
    "@typescript-eslint/ban-ts-comment": "off"
  },
  "parser": "@typescript-eslint/parser",
  "plugins": ["@typescript-eslint"],
  "overrides": [
    {
      "files": ["*.test.ts"],
      "plugins": ["jest"],
      "extends": ["plugin:jest/recommended"],
      "rules": { "jest/prefer-expect-assertions": "off" }
    }
  ]
}

{
  "trailingComma": "es5",
  "tabWidth": 2,
  "semi": true,
  "singleQuote": false
}

/* eslint-disable @typescript-eslint/no-var-requires */
const fs = require("fs");
const path = require("path");
const showdown = require("showdown");

function build_dialect(dialectName) {
  const dialectFolder = path.join(__dirname, "src", "drivers", dialectName);
  const functionFolder = path.join(dialectFolder, "functions");
  const functionFiles = fs.readdirSync(functionFolder);

  const functions = {};

  const mdConverter = new showdown.Converter({ tables: true });
  for (const functionFile of functionFiles) {
    const mdContent = fs
      .readFileSync(path.join(functionFolder, functionFile))
      .toString();

    const mdContentLines = mdContent.split("\n");

    functions[path.parse(functionFile).name] = {
      syntax: mdContentLines[0],
      description: mdConverter.makeHtml(mdContentLines.slice(2).join("\n")),
    };
  }

  fs.writeFileSync(
    path.join(dialectFolder, "function-tooltip.json"),
    JSON.stringify(functions, undefined, 2)
  );
}

build_dialect("sqlite");

{
  "$schema": "https://ui.shadcn.com/schema.json",
  "style": "new-york",
  "rsc": true,
  "tsx": true,
  "tailwind": {
    "config": "tailwind.config.js",
    "css": "src/app/globals.css",
    "baseColor": "slate",
    "cssVariables": true,
    "prefix": ""
  },
  "aliases": {
    "components": "@/components",
    "utils": "@/lib/utils"
  }
}

import { env } from "@/env";
import type { Config } from "drizzle-kit";

export default {
  schema: "./src/db/schema.ts",
  out: "./drizzle",
  driver: "turso",
  dbCredentials: {
    url: env.DATABASE_URL ?? "",
    authToken: env.DATABASE_AUTH_TOKEN,
  },
} satisfies Config;

import type { Config } from "jest";
import nextJest from "next/jest.js";

const createJestConfig = nextJest({
  // Provide the path to your Next.js app to load next.config.js and .env files in your test environment
  dir: "./",
});

// Add any custom config to be passed to Jest
const config: Config = {
  coveragePathIgnorePatterns: ["<rootDir>/.*.tsx$"],
  globals: {
    window: {},
  },
  testEnvironment: "node",
  // Add more setup options before each test is run
  setupFilesAfterEnv: ["<rootDir>/jest.setup.ts"],
};

// createJestConfig is exported this way to ensure that next/jest can load the Next.js config which is async
const overrideJestConfig = async (): Promise<Config> => {
  const c: Config = await createJestConfig(config)();
  c.transformIgnorePatterns = [
    "/node_modules/(?!(lucia)|(oslo)|(arctic)|(@lucia-auth)|(@t3-oss))",
  ];
  return c;
};

export default overrideJestConfig;

import crypto from "crypto";

Object.defineProperty(window, "crypto", {
  value: {
    randomUUID: crypto.randomUUID,
  },
});

/* eslint-disable @typescript-eslint/no-var-requires */
const withMDX = require("@next/mdx")();
const pkg = require("./package.json");

/** @type {import('next').NextConfig} */
const nextConfig = {
  reactStrictMode: false,
  pageExtensions: ["js", "jsx", "mdx", "ts", "tsx"],
  env: {
    NEXT_PUBLIC_STUDIO_VERSION: pkg.version,
  },
};

module.exports = withMDX(nextConfig);

